                      className="p-0.5 bg-white border border-slate-300 hover:bg-slate-100 disabled:opacity-50 disabled:cursor-not-allowed rounded-sm"
                    >
                       <ChevronRight size={14} className="text-slate-600" />
                    </button>
                 </div>
              </div>
           </div>
        </div>
      )}
    </div>
  );
};

