              className={`px-3 py-1 text-xs font-bold uppercase transition-all ${activeTab === 'overview' ? 'bg-white text-slate-900 border border-slate-300 shadow-sm' : 'text-slate-500 hover:text-slate-700'}`}
            >
              Visão Geral
            </button>
