import { supabase } from './supabaseClient';
import { UserProfile } from '../types';
import { SUPABASE_URL, SUPABASE_KEY } from '../constants';

export const fetchProfiles = async (): Promise<UserProfile[]> => {
  const { data, error } = await supabase
    .from('profiles')
    .select('*')
    .order('created_at', { ascending: false });

  if (error) {
    console.error('Erro ao buscar perfis:', error);
    return [];
  }
  return data as UserProfile[];
};

export const updateUserRole = async (userId: string, newRole: 'admin' | 'user') => {
  const { error } = await supabase
    .from('profiles')
    .update({ role: newRole })
    .eq('id', userId);

  if (error) throw error;
};

export const createUser = async (email: string, password: string, fullName: string, role: string) => {
  // NOTA: Para criar usuário sem deslogar o admin, idealmente usamos uma Edge Function.
  // Se não houver Edge Function, o supabase.auth.signUp desloga o usuário atual se o email confirm for false.

  try {
    const functionUrl = `${SUPABASE_URL}/functions/v1/admin-actions`;
    const response = await fetch(functionUrl, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        'Authorization': `Bearer ${SUPABASE_KEY}`
      },
      body: JSON.stringify({ 
        action: 'create_user',
        email, 
        password, 
        data: { full_name: fullName },
        role // Passamos a role desejada para a função aplicar
      })
    });

    if (!response.ok) {
       const text = await response.text();
       throw new Error(`Erro na Edge Function: ${text}`);
    }

    return await response.json();
  } catch (err: any) {
    // Fallback: Retornar erro explicativo se a função não existir
    if (err.message.includes("Failed to fetch") || err.message.includes("404")) {
        throw new Error("A Função 'admin-actions' não está configurada no Supabase. Por favor, crie o usuário manualmente no Painel do Supabase ou configure a Edge Function.");
    }
    throw err;
  }
};

