    try {
      // Optimistic update
      setProfiles(prev => prev.map(p => p.id === userId ? { ...p, role: newRole } : p));
      await updateUserRole(userId, newRole);
    } catch (err) {
      alert("Erro ao atualizar permissão.");
      loadData(); // Revert
    }
  };

  const handleCreateUser = async (e: React.FormEvent) => {
    e.preventDefault();
    setCreating(true);
    setCreateError(null);

