serve(async (req) => {
  if (req.method === 'OPTIONS') return new Response('ok', { headers: corsHeaders });

  try {
    const supabaseClient = createClient(
      // @ts-ignore
      Deno.env.get('SUPABASE_URL') ?? '',
      // @ts-ignore
      Deno.env.get('SUPABASE_ANON_KEY') ?? '',
      { global: { headers: { Authorization: req.headers.get('Authorization')! } } }
    );

    // 1. Verificar se quem chama é Admin
    const { data: { user } } = await supabaseClient.auth.getUser();
    if (!user) throw new Error("Não autenticado");

    const { data: profile } = await supabaseClient
      .from('profiles')
      .select('role')
      .eq('id', user.id)
      .single();

    if (!profile || profile.role !== 'admin') {
      return new Response(JSON.stringify({ error: "Acesso negado. Apenas Admins." }), { status: 403, headers: corsHeaders });
    }

    // 2. Criar Cliente com Service Role para criar o usuário
    const supabaseAdmin = createClient(
      // @ts-ignore
      Deno.env.get('SUPABASE_URL') ?? '',
      // @ts-ignore
      Deno.env.get('SUPABASE_SERVICE_ROLE_KEY') ?? ''
    );

    const { action, email, password, role, data } = await req.json();

    if (action === 'create_user') {
        const { data: newUser, error: createError } = await supabaseAdmin.auth.admin.createUser({
            email,
            password,
            email_confirm: true, // Auto confirma
            user_metadata: data
        });

        if (createError) throw createError;

        // Atualizar a role no profile recém criado pelo trigger
        // (O trigger cria como 'user', nós forçamos 'admin' se solicitado)
        if (role === 'admin' && newUser.user) {
            await supabaseAdmin
                .from('profiles')
                .update({ role: 'admin' })
                .eq('id', newUser.user.id);
        }

        return new Response(JSON.stringify(newUser), { headers: { ...corsHeaders, 'Content-Type': 'application/json' } });
    }

    return new Response("Ação desconhecida", { status: 400, headers: corsHeaders });

  } catch (error: any) {
    return new Response(JSON.stringify({ error: error.message }), { status: 400, headers: { ...corsHeaders, 'Content-Type': 'application/json' } });
  }
});

