import { UserProfile } from '../types';
import { SUPABASE_URL } from '../constants';

export const fetchProfiles = async (): Promise<UserProfile[]> => {
  const { data, error } = await supabase
    .from('profiles')
    .select('*')
    .order('created_at', { ascending: false });

  if (error) {
    console.error('Erro ao buscar perfis:', error);
    return [];
  }
  return data as UserProfile[];
};

export const updateUserRole = async (userId: string, newRole: 'admin' | 'user') => {
  const { error } = await supabase
    .from('profiles')
    .update({ role: newRole })
    .eq('id', userId);

  if (error) throw error;
};

export const createUser = async (email: string, password: string, fullName: string, role: string) => {
  try {
    // 1. OBTÉM O TOKEN DA SESSÃO ATUAL
    // Isso é crucial: A Edge Function precisa saber QUEM está pedindo (você), 
    // e não apenas a chave do app.
    const { data: { session } } = await supabase.auth.getSession();
    const token = session?.access_token;

    if (!token) {
        throw new Error("Sessão inválida ou expirada. Recarregue a página.");
    }

    const functionUrl = `${SUPABASE_URL}/functions/v1/admin-actions`;

    const response = await fetch(functionUrl, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        'Authorization': `Bearer ${token}` // <--- CORREÇÃO AQUI: Usa o token do usuário
      },
      body: JSON.stringify({ 
        action: 'create_user',
        email, 
        password, 
        data: { full_name: fullName },
        role 
      })
    });

    if (!response.ok) {
       const text = await response.text();

       // Tratamento amigável de erros comuns
       let errorMsg = text;
       try {
         const json = JSON.parse(text);
         if (json.error) errorMsg = json.error;
       } catch (e) {}

       throw new Error(`Erro: ${errorMsg}`);
    }

    return await response.json();
  } catch (err: any) {
    // Fallback: Retornar erro explicativo se a função não existir ou falhar na rede
    if (err.message.includes("Failed to fetch") || err.message.includes("404")) {
        throw new Error("A Função 'admin-actions' não está respondendo. Verifique se ela foi implantada (Deploy) no Supabase.");
    }
    throw err;
  }
};

-- CORREÇÃO DE SEGURANÇA E RECURSÃO (RLS)

-- 1. Criar uma função de segurança "Bypass" (Security Definer)
-- Essa função checa se é admin SEM acionar as políticas da tabela novamente (evita o loop infinito).
CREATE OR REPLACE FUNCTION public.is_admin()
RETURNS BOOLEAN
LANGUAGE plpgsql
SECURITY DEFINER -- Roda com permissões de superusuário, ignorando RLS
SET search_path = public -- Segurança extra
AS $$
BEGIN
  RETURN EXISTS (
    SELECT 1
    FROM profiles
    WHERE id = auth.uid()
    AND role = 'admin'
  );
END;
$$;

-- 2. Derrubar as políticas antigas que causam recursão
DROP POLICY IF EXISTS "Admins podem ver todos" ON public.profiles;
DROP POLICY IF EXISTS "Admins podem atualizar roles" ON public.profiles;
DROP POLICY IF EXISTS "Usuarios veem o proprio perfil" ON public.profiles;
DROP POLICY IF EXISTS "Qualquer um autenticado pode ver" ON public.profiles;

-- 3. Criar novas políticas usando a função segura

-- LEITURA: Admin vê tudo OU Usuário vê o dele mesmo
CREATE POLICY "Ver Perfis" ON public.profiles
FOR SELECT
USING (
  auth.uid() = id OR public.is_admin()
);

-- ATUALIZAÇÃO: Apenas Admin pode alterar dados (ex: roles)
CREATE POLICY "Atualizar Perfis" ON public.profiles
FOR UPDATE
USING (
  public.is_admin()
);

-- 4. Garantir permissões na função
GRANT EXECUTE ON FUNCTION public.is_admin TO authenticated;
GRANT EXECUTE ON FUNCTION public.is_admin TO anon;

