export const createUser = async (email: string, password: string, fullName: string, role: string) => {
  try {
    // O método .invoke gerencia automaticamente o cabeçalho Authorization com o token do usuário.
    // Isso evita o erro "Invalid JWT" causado por tokens expirados ou mal formatados.
    const { data, error } = await supabase.functions.invoke('admin-actions', {
      body: {
        action: 'create_user',
        email,
        password,
        data: { full_name: fullName },
        role
      }
    });

    if (error) {
       // Tratamento de erro retornado pela infraestrutura da Edge Function (Gateway) ou throw dentro da função
       let errorMsg = "Falha desconhecida";

       if (typeof error === 'string') {
           errorMsg = error;
       } else if (error && typeof error === 'object') {
           // Tenta extrair mensagem de erro do corpo ou do contexto
           errorMsg = error.message || error.context?.message || JSON.stringify(error);
       }

       // Tratamento específico para JWT inválido
       if (errorMsg.includes("Invalid JWT") || errorMsg.includes("401")) {
            throw new Error("Sessão expirada. Recarregue a página e faça login novamente.");
       }

       throw new Error(errorMsg);
    }

    // Verifica se a função retornou um erro lógico (status 200, mas com { error: ... })
    if (data && data.error) {
        throw new Error(data.error);
    }

    return data;

  } catch (err: any) {
    console.error("Erro no serviço create user:", err);
    throw new Error(err.message || "Erro de comunicação com o servidor.");
  }
};

