}

// Helper para converter valores com segurança
const safeInt = (val: any): number => {
  const n = Number(val);
  return isNaN(n) ? 0 : Math.floor(n); // Garante inteiro
};

const safeFloat = (val: any): number => {
  const n = Number(val);
  return isNaN(n) ? 0 : n;
};

// Helper para encontrar colunas com nomes parecidos (fuzzy match)
const findValue = (row: any, ...candidates: string[]) => {
  // 1. Tenta match exato
  for (const c of candidates) {
    if (row[c] !== undefined) return row[c];
  }
  // 2. Tenta match parcial
  const keys = Object.keys(row);
  for (const c of candidates) {
    // Procura uma chave que contenha a string candidata (ex: 'cheq' e 'dt')
    // Simplificação: procura chave que termine com o candidato ou contenha
    const found = keys.find(k => k.includes(c));
    if (found) return row[found];
  }
  return null;
};

serve(async (req) => {
  if (req.method === 'OPTIONS') {
    return new Response('ok', { headers: corsHeaders })
  }

  try {
    console.log("=== [START] Sync V6: Simple Unique (Filial + Lancto) ===");

    // 1. Autenticação Microsoft
    const tokenUrl = `https://login.microsoftonline.com/${AZURE_CONFIG.tenantId}/oauth2/v2.0/token`;
    const tokenBody = new URLSearchParams({
      grant_type: "client_credentials",
      client_id: AZURE_CONFIG.clientId,
      client_secret: AZURE_CONFIG.clientSecret,
      scope: AZURE_CONFIG.scope,
    });

    const tokenRes = await fetch(tokenUrl, {
      method: "POST",
      headers: { "Content-Type": "application/x-www-form-urlencoded" },
      body: tokenBody.toString()
    });

    if (!tokenRes.ok) throw new Error(`Auth Error: ${await tokenRes.text()}`);
    const { access_token } = await tokenRes.json();
    console.log("1. Auth OK");

    // 2. Query Power BI
    console.log("2. Querying Power BI...");
    const daxQuery = `EVALUATE TOPN(10000, '${AZURE_CONFIG.pbiTableName}')`; 

    const queryUrl = `https://api.powerbi.com/v1.0/myorg/groups/${AZURE_CONFIG.workspaceId}/datasets/${AZURE_CONFIG.datasetId}/executeQueries`;

    const queryRes = await fetch(queryUrl, {
      method: "POST",
      headers: {
        "Authorization": `Bearer ${access_token}`,
        "Content-Type": "application/json"
      },
      body: JSON.stringify({
        queries: [{ query: daxQuery }],
        serializerSettings: { includeNulls: true }
      })
    });

    if (!queryRes.ok) throw new Error(`PBI Error: ${await queryRes.text()}`);
    const queryData = await queryRes.json();
    const rows = queryData.results?.[0]?.tables?.[0]?.rows || [];
    console.log(`   > Received ${rows.length} rows.`);

    // 3. Mapeamento
    console.log("3. Mapping & Cleaning...");

    const rawRecords = rows.map((row: any, idx: number) => {
       // Limpeza das chaves (remove Tabela[] e espaços)
       const cleanRow: any = {};
       Object.keys(row).forEach(key => {
         let cleanKey = key;
         const match = key.match(/\[(.*?)\]/);
         if (match) cleanKey = match[1];
         cleanKey = cleanKey.trim().toLowerCase().replace(/\s+/g, '_'); // Substitui espaços por _
         cleanRow[cleanKey] = row[key];
       });

       // Debug da 1ª linha para encontrar colunas perdidas
       if (idx === 0) {
         console.log("[DEBUG] Clean Keys Sample:", Object.keys(cleanRow).join(', '));
       }

       // Fuzzy Find para cheq_dt_data se não existir direto
       let cheqDtData = cleanRow['cheq_dt_data'];
       if (cheqDtData === undefined) {
          // Tenta encontrar algo que pareça data de cheque
          const fuzzyKey = Object.keys(cleanRow).find(k => k.includes('cheq') && (k.includes('dt') || k.includes('data')));
          if (fuzzyKey) {
             console.log(`[INFO] Mapped 'cheq_dt_data' from '${fuzzyKey}'`);
             cheqDtData = cleanRow[fuzzyKey];
          }
       }

       const parseDate = (v: any) => {
         if (!v) return null;
         try {
           return new Date(v).toISOString().split('T')[0];
         } catch { return null; }
       };

       return {
          agn_in_codigo: safeInt(cleanRow.agn_in_codigo),
          valor: safeFloat(cleanRow.valor),
          mov_dt_vencto: parseDate(cleanRow.mov_dt_vencto),
          mov_dt_datadocto: parseDate(cleanRow.mov_dt_datadocto),
          mov_ch_natureza: cleanRow.mov_ch_natureza || 'C',
          fpa_st_favorecido: cleanRow.fpa_st_favorecido,
          mov_ch_conciliado: cleanRow.mov_ch_conciliado || 'N',
          fil_in_codigo: safeInt(cleanRow.fil_in_codigo),
          rcb_st_nota: cleanRow.rcb_st_nota,
          cheqbx_re_vrbaixa: safeFloat(cleanRow.cheqbx_re_vrbaixa),
          cheqbx_re_vrjuros: safeFloat(cleanRow.cheqbx_re_vrjuros),
          conta_baixa: safeInt(cleanRow.conta_baixa),
          cpa_in_ap: safeInt(cleanRow.cpa_in_ap),
          cpa_st_documento: cleanRow.cpa_st_documento,
          cpa_st_parcela: cleanRow.cpa_st_parcela,
          fpa_dt_emissao: parseDate(cleanRow.fpa_dt_emissao),
          fpa_in_contador: safeInt(cleanRow.fpa_in_contador),
          fpa_in_numero: safeInt(cleanRow.fpa_in_numero),
          fpa_st_doctointerno: cleanRow.fpa_st_doctointerno,
          fpa_tpd_st_codigo: cleanRow.fpa_tpd_st_codigo,
          mov_in_numlancto: safeInt(cleanRow.mov_in_numlancto),
          mov_re_saldocpacre: safeFloat(cleanRow.mov_re_saldocpacre),
          org_in_codigo: safeInt(cleanRow.org_in_codigo),
          cheq_dt_data: parseDate(cheqDtData), 
       };
    });

    // 3.1 DESDUPLICAÇÃO SIMPLIFICADA (Filial + Lancto)
    console.log("3.1 Deduplicating (Filial + Lancto)...");
    const uniqueMap = new Map();
    rawRecords.forEach((r: any) => {
        // Chave composta simples: Filial + NumLancto
        const uniqueKey = `${r.fil_in_codigo}|${r.mov_in_numlancto}`;
        uniqueMap.set(uniqueKey, r);
    });

    const records = Array.from(uniqueMap.values());
    console.log(`   > Raw: ${rawRecords.length} -> Unique: ${records.length}`);

    // 4. Upsert
    // @ts-ignore
    const supabaseUrl = Deno.env.get('SUPABASE_URL') ?? '';
    // @ts-ignore
    // USA SERVICE_ROLE_KEY SE DISPONIVEL, SENAO TENTA A ORIGINAL, SENAO A ANON (ULTIMO RECURSO)
    const supabaseKey = Deno.env.get('SERVICE_ROLE_KEY') ?? Deno.env.get('SUPABASE_SERVICE_ROLE_KEY') ?? Deno.env.get('SUPABASE_ANON_KEY') ?? '';
    const supabase = createClient(supabaseUrl, supabaseKey);

    console.log("4. Upserting to Supabase...");

    const BATCH_SIZE = 1000;
    let totalUpserted = 0;

    for (let i = 0; i < records.length; i += BATCH_SIZE) {
        const batch = records.slice(i, i + BATCH_SIZE);

        const { error: dbError } = await supabase
          .from('rel_financeiro')
          .upsert(batch, { 
            // IMPORTANTE: A Constraint no banco deve ser UNIQUE(fil_in_codigo, mov_in_numlancto)
            onConflict: 'fil_in_codigo,mov_in_numlancto', 
            ignoreDuplicates: false 
          });

        if (dbError) {
            console.error(`   [ERROR] Batch ${i}:`, dbError);
            throw dbError; 
        }
        totalUpserted += batch.length;
    }

    console.log(`=== SUCCESS: ${totalUpserted} rows processed ===`);

    return new Response(
      JSON.stringify({ success: true, count: totalUpserted, message: `Sync Complete: ${totalUpserted} records.` }),
      { headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
    );

  } catch (error: any) {
    console.error("=== FATAL ERROR ===", error);
    return new Response(
      JSON.stringify({ success: false, message: error.message }),
      { 
        status: 500, 
        headers: { ...corsHeaders, 'Content-Type': 'application/json' } 
      }
    )
  }
})

// Deno Edge Function: 'admin-actions'
// IMPORTANTE: Adicione as Secrets no Painel: SUPABASE_URL, SUPABASE_ANON_KEY e SERVICE_ROLE_KEY

import { serve } from "https://deno.land/std@0.168.0/http/server.ts"
import { createClient } from "https://esm.sh/@supabase/supabase-js@2"

const corsHeaders = {
  'Access-Control-Allow-Origin': '*',
  'Access-Control-Allow-Headers': 'authorization, x-client-info, apikey, content-type',
}

serve(async (req) => {
  // Handle CORS preflight requests
  if (req.method === 'OPTIONS') {
    return new Response('ok', { headers: corsHeaders })
  }

  try {
    console.log("[Admin Function] Iniciando...");

    // -----------------------------------------------------------------------
    // 1. DIAGNÓSTICO DE AMBIENTE (DEBUG)
    // Verifica quais chaves o Supabase injetou no ambiente
    // -----------------------------------------------------------------------
    const envVars = Deno.env.toObject();
    const keys = Object.keys(envVars);
    const supabaseKeys = keys.filter(k => 
        k.toUpperCase().includes('SUPABASE') || 
        k.toUpperCase().includes('KEY') || 
        k.toUpperCase().includes('ROLE')
    );

    console.log(`[DIAGNOSTICO] Chaves encontradas no ambiente (${supabaseKeys.length}):`, supabaseKeys);

    // 2. Recupera as chaves
    // @ts-ignore
    const supabaseUrl = Deno.env.get('SUPABASE_URL');
    // @ts-ignore
    const supabaseAnonKey = Deno.env.get('SUPABASE_ANON_KEY');

    // Tenta pegar a chave manual (SERVICE_ROLE_KEY) ou a padrão (SUPABASE_SERVICE_ROLE_KEY)
    // @ts-ignore
    const serviceRoleKey = Deno.env.get('SERVICE_ROLE_KEY') ?? Deno.env.get('SUPABASE_SERVICE_ROLE_KEY');

    // 3. Validação Explícita
    const missingKeys = [];
    if (!supabaseUrl) missingKeys.push("SUPABASE_URL");
    if (!supabaseAnonKey) missingKeys.push("SUPABASE_ANON_KEY");
    if (!serviceRoleKey) missingKeys.push("SERVICE_ROLE_KEY");

    if (missingKeys.length > 0) {
        const msg = `ERRO FATAL DE CONFIGURAÇÃO: Faltam as seguintes Secrets no painel: ${missingKeys.join(', ')}. Vá em Edge Functions > admin-actions > Secrets e adicione-as.`;
        console.error(msg);
        throw new Error(msg);
    }

    console.log("[DIAGNOSTICO] Configuração OK. Todas as chaves necessárias estão presentes.");

    // 4. Criar Cliente para verificar QUEM está chamando
    const authHeader = req.headers.get('Authorization');
    if (!authHeader) {
        throw new Error("Token de autorização ausente.");
    }

    const supabaseClient = createClient(supabaseUrl, supabaseAnonKey, { 
        global: { headers: { Authorization: authHeader } } 
    });

    // 5. Verificar Usuário
    const { data: { user }, error: userError } = await supabaseClient.auth.getUser();
    if (userError || !user) {
        throw new Error("Usuário não autenticado ou token inválido.");
    }

    console.log(`[Admin Function] Usuário autenticado: ${user.email}`);

    // 6. Verificar se é Admin
    const { data: profile, error: profileError } = await supabaseClient
      .from('profiles')
      .select('role')
      .eq('id', user.id)
      .single();

    if (profileError || !profile || profile.role !== 'admin') {
      console.warn(`[Admin Function] Acesso negado para ${user.email}. Role: ${profile?.role}`);
      return new Response(
        JSON.stringify({ error: "Acesso negado. Apenas administradores podem realizar esta ação." }), 
        { status: 403, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
      );
    }

    // 7. Instanciar Cliente ADMIN (Service Role)
    const supabaseAdmin = createClient(supabaseUrl, serviceRoleKey);

    // 8. Executar Ação
    const { action, email, password, role, data } = await req.json();
    console.log(`[Admin Function] Executando ação: ${action} para ${email}`);

    if (action === 'create_user') {
        if (!email || !password) throw new Error("Email e senha são obrigatórios.");

        const { data: newUser, error: createError } = await supabaseAdmin.auth.admin.createUser({
            email,
            password,
            email_confirm: true,
            user_metadata: data
        });

        if (createError) throw createError;

        if (role === 'admin' && newUser.user) {
            const { error: updateError } = await supabaseAdmin
                .from('profiles')
                .update({ role: 'admin' })
                .eq('id', newUser.user.id);

            if (updateError) console.error("Erro ao promover admin:", updateError);
        }

        return new Response(
            JSON.stringify(newUser), 
            { status: 200, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
        );
    }

    return new Response(
        JSON.stringify({ error: `Ação '${action}' não reconhecida.` }), 
        { status: 400, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
    );

  } catch (error: any) {
    console.error("[Admin Function] Erro capturado:", error);

    return new Response(
      JSON.stringify({ 
          error: error.message || "Erro interno no servidor.", 
          details: error.toString() 
      }),
      { 
        status: 400, 
        headers: { ...corsHeaders, 'Content-Type': 'application/json' } 
      }
    )
  }
});

import { supabase } from './supabaseClient';
import { UserProfile } from '../types';

export const fetchProfiles = async (): Promise<UserProfile[]> => {
  const { data, error } = await supabase
    .from('profiles')
    .select('*')
    .order('created_at', { ascending: false });

  if (error) {
    console.error('Erro ao buscar perfis:', error);
    return [];
  }
  return data as UserProfile[];
};

export const updateUserRole = async (userId: string, newRole: 'admin' | 'user') => {
  const { error } = await supabase
    .from('profiles')
    .update({ role: newRole })
    .eq('id', userId);

  if (error) throw error;
};

export const createUser = async (email: string, password: string, fullName: string, role: string) => {
  try {
    const { data, error } = await supabase.functions.invoke('admin-actions', {
      body: {
        action: 'create_user',
        email,
        password,
        data: { full_name: fullName },
        role
      }
    });

    if (error) {
       console.error("Erro retornado pelo invoke:", error);

       let errorMsg = "";

       // 1. Tenta pegar a mensagem de erro do objeto Error padrão
       if (error instanceof Error) {
         errorMsg = error.message;
       } 
       // 2. Tenta pegar de um objeto genérico (FunctionsHttpError)
       else if (typeof error === 'object' && error !== null) {
         // Verifica se tem contexto com resposta JSON da nossa Edge Function
         const ctx = (error as any).context;
         if (ctx && typeof ctx === 'object') {
            if (ctx.error) errorMsg = ctx.error;
            else if (ctx.message) errorMsg = ctx.message;
         }

         // Se não achou no contexto, pega a mensagem base
         if (!errorMsg && (error as any).message) {
            errorMsg = (error as any).message;
         }
       }

       // 3. Fallback se ainda estiver vazio
       if (!errorMsg) errorMsg = "Erro desconhecido na Edge Function.";

       // 4. Intercepta erros comuns para dar dicas
       if (errorMsg.includes("non-2xx") || errorMsg.includes("status code") || errorMsg.includes("Faltam as seguintes Secrets")) {
           errorMsg = "Falha na Configuração: Verifique se as Secrets (SUPABASE_URL, SUPABASE_ANON_KEY, SERVICE_ROLE_KEY) foram adicionadas na Edge Function no painel.";
       }

       throw new Error(errorMsg);
    }

    // Verifica erro lógico retornado no corpo da resposta (data)
    if (data && data.error) {
        throw new Error(data.error);
    }

    return data;

  } catch (err: any) {
    console.error("Erro no serviço create user:", err);
    throw new Error(err.message || "Erro de comunicação com o servidor.");
  }
};

// Deno Edge Function: 'admin-actions'

import { serve } from "https://deno.land/std@0.168.0/http/server.ts"
import { createClient } from "https://esm.sh/@supabase/supabase-js@2"

const corsHeaders = {
  'Access-Control-Allow-Origin': '*',
  'Access-Control-Allow-Headers': 'authorization, x-client-info, apikey, content-type',
}

serve(async (req) => {
  // Handle CORS preflight requests
  if (req.method === 'OPTIONS') {
    return new Response('ok', { headers: corsHeaders })
  }

  try {
    console.log("[Admin Function] Iniciando verificação de chaves...");

    // -----------------------------------------------------------------------
    // 1. RECUPERAÇÃO DAS CHAVES COM MÚLTIPLAS TENTATIVAS
    // -----------------------------------------------------------------------

    // URL e ANON KEY (Geralmente injetados automaticamente, mas verificamos)
    // @ts-ignore
    const supabaseUrl = Deno.env.get('SUPABASE_URL');
    // @ts-ignore
    const supabaseAnonKey = Deno.env.get('SUPABASE_ANON_KEY');

    // SERVICE ROLE KEY (A chave crítica)
    // Tentamos várias variações de nome para garantir que pegamos o que você configurou
    // @ts-ignore
    const serviceKeyCandidate1 = Deno.env.get('SERVICE_ROLE_KEY');          // Nome personalizado que criamos
    // @ts-ignore
    const serviceKeyCandidate2 = Deno.env.get('SUPABASE_SERVICE_ROLE_KEY'); // Nome padrão reservado
    // @ts-ignore
    const serviceKeyCandidate3 = Deno.env.get('MY_SECRET_KEY');             // Tentativa extra

    const serviceRoleKey = serviceKeyCandidate1 || serviceKeyCandidate2 || serviceKeyCandidate3;

    // -----------------------------------------------------------------------
    // 2. DIAGNÓSTICO E RETORNO DE ERRO CONTROLADO
    // -----------------------------------------------------------------------
    const missingKeys = [];
    if (!supabaseUrl) missingKeys.push("SUPABASE_URL");
    if (!supabaseAnonKey) missingKeys.push("SUPABASE_ANON_KEY");
    if (!serviceRoleKey) missingKeys.push("SERVICE_ROLE_KEY (ou SUPABASE_SERVICE_ROLE_KEY)");

    // Logs para o painel do Supabase
    console.log(`[DIAGNOSTICO] URL definida? ${!!supabaseUrl}`);
    console.log(`[DIAGNOSTICO] ANON KEY definida? ${!!supabaseAnonKey}`);
    console.log(`[DIAGNOSTICO] SERVICE KEY definida? ${!!serviceRoleKey} (Tentei: SERVICE_ROLE_KEY, SUPABASE_SERVICE_ROLE_KEY)`);

    if (missingKeys.length > 0) {
        const errorMsg = `FALTA CONFIGURAÇÃO: As seguintes Secrets não foram encontradas em 'Edge Functions > admin-actions > Secrets': ${missingKeys.join(', ')}.`;
        console.error(errorMsg);

        // Retorna 500 mas com JSON explicativo para o frontend mostrar
        return new Response(
            JSON.stringify({ error: errorMsg }), 
            { status: 500, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
        );
    }

    // -----------------------------------------------------------------------
    // 3. LÓGICA DA FUNÇÃO
    // -----------------------------------------------------------------------

    // Criar Cliente para verificar QUEM está chamando (Autenticação do Usuário logado)
    const authHeader = req.headers.get('Authorization');
    if (!authHeader) {
        return new Response(
            JSON.stringify({ error: "Token de autorização ausente." }), 
            { status: 401, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
        );
    }

    // Cliente "Normal" (Respeita RLS)
    const supabaseClient = createClient(supabaseUrl, supabaseAnonKey, { 
        global: { headers: { Authorization: authHeader } } 
    });

    const { data: { user }, error: userError } = await supabaseClient.auth.getUser();
    if (userError || !user) {
        return new Response(
            JSON.stringify({ error: "Usuário não autenticado ou token expirado." }), 
            { status: 401, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
        );
    }

    console.log(`[Admin Function] Solicitante: ${user.email}`);

    // Verificar se é Admin (consuta tabela profiles)
    const { data: profile } = await supabaseClient
      .from('profiles')
      .select('role')
      .eq('id', user.id)
      .single();

    if (!profile || profile.role !== 'admin') {
      console.warn(`[Admin Function] Bloqueado. ${user.email} não é admin.`);
      return new Response(
        JSON.stringify({ error: "Acesso negado. Apenas administradores podem realizar esta ação." }), 
        { status: 403, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
      );
    }

    // --- AQUI COMEÇA A MÁGICA ---
    // Instanciar Cliente ADMIN com a chave que recuperamos lá em cima
    const supabaseAdmin = createClient(supabaseUrl, serviceRoleKey);

    const { action, email, password, role, data } = await req.json();
    console.log(`[Admin Function] Ação: ${action} | Alvo: ${email}`);

    if (action === 'create_user') {
        if (!email || !password) {
            return new Response(
                JSON.stringify({ error: "Email e senha são obrigatórios." }), 
                { status: 400, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
            );
        }

        // 1. Cria o usuário no Auth (bypass email confirm se quiser)
        const { data: newUser, error: createError } = await supabaseAdmin.auth.admin.createUser({
            email,
            password,
            email_confirm: true, // Já confirma o email para poder logar direto
            user_metadata: data
        });

        if (createError) {
            console.error("Erro ao criar usuário:", createError);
            throw createError;
        }

        // 2. Se for Admin, atualiza a tabela profiles
        if (role === 'admin' && newUser.user) {
            // Pequeno delay para garantir que o trigger (se houver) rodou
            // Mas como estamos usando admin client, podemos fazer upsert direto
            const { error: updateError } = await supabaseAdmin
                .from('profiles')
                .upsert({ 
                    id: newUser.user.id,
                    email: email,
                    full_name: data.full_name,
                    role: 'admin' 
                });

            if (updateError) {
                 console.error("Erro ao definir como admin:", updateError);
            }
        }

        return new Response(
            JSON.stringify(newUser), 
            { status: 200, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
        );
    }

    return new Response(
        JSON.stringify({ error: `Ação '${action}' desconhecida.` }), 
        { status: 400, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
    );

  } catch (error: any) {
    console.error("[Admin Function] Erro Fatal:", error);

    return new Response(
      JSON.stringify({ 
          error: error.message || "Erro interno na Edge Function.", 
          details: String(error)
      }),
      { 
        status: 500, 
        headers: { ...corsHeaders, 'Content-Type': 'application/json' } 
      }
    )
  }
});

