        global: { headers: { Authorization: authHeader } } 
    });

    const { data: { user }, error: userError } = await supabaseClient.auth.getUser();
    if (userError || !user) {
        return new Response(
            JSON.stringify({ error: "Usuário não autenticado ou token expirado." }), 
            { status: 401, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
        );
    }

    console.log(`[Admin Function] Solicitante: ${user.email}`);

    // Verificar se é Admin (consulta tabela profiles OU whitelist)
    const { data: profile } = await supabaseClient
      .from('profiles')
      .select('role')
      .eq('id', user.id)
      .single();

    // LISTA DE SUPER ADMINS - Whitelist para garantir acesso
    const SUPER_ADMINS = ['ti@grupoairslaid.com.br', 'cassia@grupoairslaid.com.br'];

    const isDbAdmin = profile && profile.role === 'admin';
    const isSuperAdmin = user.email && SUPER_ADMINS.includes(user.email);

    if (!isDbAdmin && !isSuperAdmin) {
      console.warn(`[Admin Function] Bloqueado. ${user.email} não é admin.`);
      return new Response(
        JSON.stringify({ error: "Acesso negado. Apenas administradores podem realizar esta ação." }), 
        { status: 403, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
      );
    }

    // --- AQUI COMEÇA A MÁGICA ---
    // Instanciar Cliente ADMIN com a chave que recuperamos lá em cima
    const supabaseAdmin = createClient(supabaseUrl!, serviceRoleKey!);

    const { action, email, password, role, data } = await req.json();
    console.log(`[Admin Function] Ação: ${action} | Alvo: ${email}`);

    if (action === 'create_user') {
        if (!email || !password) {
            return new Response(
                JSON.stringify({ error: "Email e senha são obrigatórios." }), 
                { status: 400, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
            );
        }

        // 1. Cria o usuário no Auth
        const { data: newUser, error: createError } = await supabaseAdmin.auth.admin.createUser({
            email,
            password,
            email_confirm: true, 
            user_metadata: data
        });

        if (createError) {
            console.error("Erro ao criar usuário:", createError);
            throw createError;
        }

        // 2. Se for Admin, atualiza a tabela profiles
        if (role === 'admin' && newUser.user) {
            const { error: updateError } = await supabaseAdmin
                .from('profiles')
                .upsert({ 
                    id: newUser.user.id,
                    email: email,
                    full_name: data.full_name,
                    role: 'admin' 
                });

            if (updateError) {
                 console.error("Erro ao definir como admin:", updateError);
            }
        }

        return new Response(
            JSON.stringify(newUser), 
            { status: 200, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
        );
    }

    return new Response(
        JSON.stringify({ error: `Ação '${action}' desconhecida.` }), 
        { status: 400, headers: { ...corsHeaders, 'Content-Type': 'application/json' } }
    );

  } catch (error: any) {
    console.error("[Admin Function] Erro Fatal:", error);

    return new Response(
      JSON.stringify({ 
          error: error.message || "Erro interno na Edge Function.", 
          details: String(error)
      }),
      { 
        status: 500, 
        headers: { ...corsHeaders, 'Content-Type': 'application/json' } 
      }
    )
  }
});

import React, { useState } from 'react';
import { supabase } from '../services/supabaseClient';
import { CircleDollarSign, Loader2, Lock, Mail, ArrowRight, AlertCircle } from 'lucide-react';

export const Login: React.FC = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const handleLogin = async (e: React.FormEvent) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      // .trim() remove espaços antes e depois do email (erro comum de copy-paste)
      const { error } = await supabase.auth.signInWithPassword({
        email: email.trim(),
        password,
      });

      if (error) throw error;
    } catch (err: any) {
      console.error("Login Error:", err);
      setError(err.message || 'Falha na autenticação');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-slate-50 flex items-center justify-center p-4 font-inter">
      <div className="max-w-md w-full bg-white border border-slate-200 shadow-xl rounded-lg overflow-hidden">
        {/* Header */}
        <div className="bg-slate-900 p-8 text-center relative overflow-hidden">
          <div className="absolute top-0 left-0 w-full h-1 bg-gradient-to-r from-rose-500 to-rose-700"></div>
          <div className="flex justify-center mb-4">
            <div className="w-12 h-12 bg-rose-700 rounded-md flex items-center justify-center shadow-lg">
              <CircleDollarSign size={28} className="text-white" strokeWidth={2.5} />
            </div>
          </div>
          <h2 className="text-2xl font-bold text-white tracking-tight">Air<span className="text-rose-500">Finance</span></h2>
          <p className="text-slate-400 text-sm mt-2">Sistema de Gestão Financeira</p>
        </div>

        {/* Form */}
        <div className="p-8">
          <form onSubmit={handleLogin} className="space-y-5">
            {error && (
              <div className="bg-red-50 border-l-4 border-red-500 p-4 flex items-start gap-3 rounded-sm">
                <AlertCircle className="text-red-500 shrink-0 mt-0.5" size={18} />
                <div className="text-sm text-red-700">
                   <p className="font-bold">Não foi possível entrar</p>
                   <p>{error === "Invalid login credentials" ? "E-mail ou senha incorretos." : error}</p>
                </div>
              </div>
            )}

            <div>
              <label className="block text-xs font-bold text-slate-600 uppercase mb-1">E-mail Corporativo</label>
              <div className="relative">
                <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                  <Mail size={16} className="text-slate-400" />
                </div>
                <input
                  type="email"
                  required
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  className="block w-full pl-10 pr-3 py-2 border border-slate-300 rounded-sm text-sm placeholder-slate-400 focus:outline-none focus:border-rose-500 focus:ring-1 focus:ring-rose-500 transition-colors"
                  placeholder="usuario@empresa.com"
                />
              </div>
            </div>

            <div>
              <label className="block text-xs font-bold text-slate-600 uppercase mb-1">Senha</label>
              <div className="relative">
                <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                  <Lock size={16} className="text-slate-400" />
                </div>
                <input
                  type="password"
                  required
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  className="block w-full pl-10 pr-3 py-2 border border-slate-300 rounded-sm text-sm placeholder-slate-400 focus:outline-none focus:border-rose-500 focus:ring-1 focus:ring-rose-500 transition-colors"
                  placeholder="••••••••"
                />
              </div>
            </div>

            <button
              type="submit"
              disabled={loading}
              className="w-full flex justify-center items-center py-2.5 px-4 border border-transparent rounded-sm shadow-sm text-sm font-bold text-white bg-rose-700 hover:bg-rose-800 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-rose-500 disabled:opacity-70 disabled:cursor-wait transition-all"
            >
              {loading ? (
                <>
                  <Loader2 size={16} className="animate-spin mr-2" />
                  Autenticando...
                </>
              ) : (
                <>
                  Acessar Sistema
                  <ArrowRight size={16} className="ml-2" />
                </>
              )}
            </button>
          </form>

          <div className="mt-6 text-center">
            <p className="text-xs text-slate-400">
              Esqueceu sua senha? Contate o administrador.
            </p>
          </div>
        </div>

        <div className="bg-slate-50 px-8 py-4 border-t border-slate-200 flex justify-between items-center text-xs text-slate-500">
            <span>&copy; {new Date().getFullYear()} AirFinance</span>
            <span>v1.0.4</span>
        </div>
      </div>
    </div>
  );
};
